import React, { useState } from 'react';
import { fetchDailyData } from '../../api';

const CountryPicker = () => {
    const [dailyData, setDailyData] = useState({});

    useEffect(() => {
        const fetchAPI = async() => {
            setDailyData(await fetchDailyData());
        }

        fetchAPI();
    });

    return (
        <h1>CountryPicker</h1>
    )
}

export default CountryPicker;
